import styled from 'styled-components';

export const Head4 = styled.h4`
	margin:        3rem 0 3rem 0;	
	font-size: 2.25em;
	color: var(--white);
	font-weight: 200;
	position: relative;
	line-height: 1.5;
&:@media screen and (min-width: 768px) {
  font-size:     .45rem;
  }
`;
